import Card from 'react-bootstrap/Card';
import Row from 'react-bootstrap/Row'
import Col from 'react-bootstrap/Col'

const Link = props => {
    var text;
    if(props.text) {
        text = props.text;
    } else {
        text = props.url;
    }
    return (

        <div className="card text-dark bg-warning mb-3">
            <div className="card-header">{props.project}}</div>
            <div className="card-body">
                <div className="card-text" href={props.url}>{text}</div>
            </div>
        </div>
    )
}

export default Link;
